import React from 'react';
const Post = (props) => {
    return (
        <div>
            <div>
            <p className="user__name">{props.name}</p>
            <p className="nick__name">{props.name}</p>
            </div>
        </div>
    );
}
Post.defaultProps = {name: "Anakin skywalker", nickname: "@dart_vader"};
export default Post;
